import React, { useState, useEffect } from "react";
import axios from "axios";
import Vehicle from "../component/Vehicle";
import Error from "../component/Error";
import "antd/dist/reset.css";
import { DatePicker } from "antd";
import moment from "moment";

function Caterine() {
  const [vehicles, setVehicles] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(false);
  const [fromDate, setFromDate] = useState(null);
  const [toDate, setToDate] = useState(null);
  const [duplicateVehicles, setDuplicateVehicles] = useState([]);
  const [searchKey, setSearchKey] = useState("");
  const [type, setType] = useState("all");

  useEffect(() => {
    const source = axios.CancelToken.source();

    const fetchData = async () => {
      try {
        setLoading(true);
        const response = await axios.get("/api/gettallvehicles", {
          cancelToken: source.token,
        });
        const data = response.data;

        setVehicles(data);
        setDuplicateVehicles(data);
        setLoading(false);
      } catch (error) {
        setError(true);
        setLoading(false);
      }
    };

    fetchData();

    return () => {
      source.cancel();
    };
  }, []);

  function filterBySearch() {
    const tempVehicles = duplicateVehicles.filter((vehicle) =>
      vehicle.name.toLowerCase().includes(searchKey.toLowerCase())
    );
    setVehicles(tempVehicles);
